def delayed_input(text, username1):
    for letter in text:
        username1.send_keys(letter)

        ran = random.uniform(0.01,1)
        time.sleep(ran) 
    username1.submit()

def delayed_input(text, password1):
    for letter in text:
        password1.send_keys(letter)

        ran = random.uniform(0.01,1)
        time.sleep(ran) 
    password1.submit()
    

